        .luna-console {

        .luna-console-hidden {
            display: none

            left: 0;

            position: absolute;
            top: 0;
            visibility: hidden;
            width: 100%
        }

        .luna-console-fake-logs * {
            color: #000;
            overflow: hidden;
            position: static
        }

        .luna-console-logs {
            padding-top: 1px;
            position: absolute;
            width: 100%
        }

        .luna-console-log-container {

        }

        .luna-console-header {

            color: #545454;

            font-size: 11px;
            white-space: nowrap
        }

        .luna-console-header .luna-console-time-from-container {

            overflow-x: auto;
            padding: 3px 10px
        }

        .luna-console-nesting-level {

            margin-top: -1px;
            position: relative;
            width: 14px
        }

        .luna-console-nesting-level.luna-console-group-closed:before {
            content: ""
        }

        .luna-console-nesting-level:before {
            border-bottom: 1px solid #ccc;
            box-sizing: border-box;
            height: 100%;
            left: 0;
            margin-left: 100%;
            position: absolute;
            top: 0;
            width: 5px
        }

            border-top: 1px solid transparent;
            color: #333;
            display: flex;

        }
